import pandas as pd
from pandas.core.frame import DataFrame
import os


def merge_base_feature():
    # 合并base_info和 his_feature
    base_info = DataFrame(pd.read_csv(
        "data/user_base_info.csv"))
    his_features = DataFrame(pd.read_csv(
        "data/user_his_features.csv"))

    user_all_info = base_info.merge(his_features, how='right', on='id')

    if os.path.isdir("data/28_dimension") == 0:
        os.mkdir("data/28_dimension")
    user_all_info.to_csv("data/28_dimension/all_info.csv",
                         sep=',', index=False, header=True)


def add_track():
    # 把 user_track信息填到总数据集中
    if os.path.exists("data/33_dimension/all_info.csv"):
        return

    user_track = DataFrame(pd.read_csv("data/user_track.csv"))
    user_all_info = DataFrame(pd.read_csv(
        "data/28_dimension/all_info.csv"))
    work_day_count = [0] * (user_all_info.shape[0]+1)
    weekend_day_count = [0] * (user_all_info.shape[0]+1)
    avg_early_hour = [0.0] * (user_all_info.shape[0]+1)
    avg_last_hour = [0.0] * (user_all_info.shape[0]+1)
    total_day = [0] * (user_all_info.shape[0]+1)

    for i in range(user_track.shape[0]):
        # 统计登录日期类型
        total_day[user_track['id'][i]] += 1
        work_day_count[user_track['id'][i]] += user_track['is_weekend'][i] == 0
        weekend_day_count[user_track['id'][i]
                          ] += user_track['is_weekend'][i] != 0
        # 统计平均最早最晚登录时间
        avg_early_hour[user_track['id'][i]] = (avg_early_hour[user_track['id'][i]] * (
            total_day[user_track['id'][i]]-1) + user_track['early_hour'][i]) / total_day[user_track['id'][i]]
        avg_last_hour[user_track['id'][i]] = (avg_last_hour[user_track['id'][i]] * (
            total_day[user_track['id'][i]]-1) + user_track['last_hour'][i]) / total_day[user_track['id'][i]]

    # 保存到 all_info
    work_day_count.pop(0)
    weekend_day_count.pop(0)
    avg_early_hour.pop(0)
    avg_last_hour.pop(0)
    total_day.pop(0)
    user_all_info['total_day'] = total_day
    user_all_info['work_day_rate'] = [
        m/(n+0.001) for m, n in zip(work_day_count, total_day)]
    user_all_info['weekend_day_rate'] = [
        m/(n+0.001) for m, n in zip(weekend_day_count, total_day)]
    user_all_info['avg_early_hour'] = avg_early_hour
    user_all_info['avg_last_hour'] = avg_last_hour

    if os.path.isdir("data/33_dimension") == 0:
        os.mkdir("data/33_dimension")
    user_all_info.to_csv("data/33_dimension/all_info.csv",
                         sep=',', index=False, header=True)


def generate_test(test_path):
    # 生成对应路径下的测试集
    test = DataFrame(pd.read_csv("data/test_b.csv"))
    all_info = DataFrame(pd.read_csv(f"{test_path}/all_info.csv"))

    result = all_info.merge(test, how='right', on='id')
    result.drop(columns=['label'], inplace=True)
    result.to_csv(f"{test_path}/test.csv", sep=',', index=False, header=True)


