def normalize():
    train = pd.read_csv("data/33_dimension/train.csv")
    valid = pd.read_csv("data/33_dimension/valid.csv")
    all = pd.read_csv("data/33_dimension/all_info.csv")

    train_id = train['id']
    train_label = train['label']
    valid_id = valid["id"]
    valid_label = valid["label"]
    all_id = all["id"]

    # 按列归一化 ———— max-min
    train = (train-train.min())/(train.max()-train.min())
    valid = (valid-valid.min())/(valid.max()-valid.min())
    all = (all-all.min())/(all.max()-all.min())

    train['id'] = train_id
    train['label'] = train_label
    valid['id'] = valid_id
    valid['label'] = valid_label
    all['id'] = all_id

    if os.path.isdir("data/33_normalized") == 0:
        os.mkdir("data/33_normalized")
    train.to_csv("data/33_normalized/train.csv",
                 sep=',', index=False, header=True)
    valid.to_csv("data/33_normalized/valid.csv",
                 sep=',', index=False, header=True)
    all.to_csv("data/33_normalized/all_info.csv",
               sep=',', index=False, header=True)


def ML_balanced_train(dataset):
    data = DataFrame(pd.read_csv(dataset))
    p_n = len([1 for i in range(data.shape[0]) if data['label'][i] == 1])

    count = 1
    for i in range(data.shape[0]):
        if(data['label'][i] == 0):
            if(count > p_n*1.5):
                data.drop(index=i, inplace=True)
            else:
                count += 1
    data.to_csv(dataset, sep=',', index=False, header=True)


